import React from "react";

const ArtistItem = () => {
  return (
    <div className='artist-container'>
      <div className='artist-rank'></div>
      <div className='artist-picture'></div>
      <div className='artist-information'>
        <div className='artist-name'></div>
        <div className='artist-location'></div>
      </div>
      <div className='artist-stats'>
        <div className='artist-photos-sold'></div>
        <div className='artist-photo-views'></div>
      </div>
      <div className='divider'></div>
      <div className='top-photo-information'>
        <div className='top-photo-name'></div>
        <div className='top-photo-views'></div>
        <div className='top-photo-avg-price'></div>
        <div className='top-photo-location'></div>
      </div>
      <div className='artist-top-photo'></div>
    </div>
  );
};

export default ArtistItem;
